import style from './Login.css'

const Div = style()
const Login = () => {
  return (
    <Div>
        <div className='form-container'>
            <form>
                <input type="email" pplaceholder="Enterr emaiil" />
                <></>
            </form>
        </div>
    </Div>
  )
}

export default Login
